The purpose of this tender exercise was to select a service provider whose delivery of Radiation Protection and Medical Physics Services would represent value for money, high quality service, combined with the ability to identify and implement service efficiencies across the Trust.

Additional information: Objectives:
- To enable the Trust to meet its statutory and non-statutory obligations, including related legislation, for the safe use of ionising and non-ionising radiation;
- To improve the quality and effectiveness of radiation usage as part of medical audit and to check that doses are As Low As Reasonably Achievable (ALARA);
- To advance and keep abreast of the scientific developments in radiation protection, radiotherapy and imaging physics and keep the Trust so informed;
- To improve the efficiency of associated record keeping and document management systems;
- To respond to radiation incidents in a timely and efficient manner;
- To monitor personnel radiation doses and to investigate any causes for concern in a timely manner.
